import React from "react";

import MyYoutube from "./Youtube";

const GenreVideoCard = () => {
  const opt1 = {
    height: "300",
    width: "100%",
    playerVars: {
      // https://developers.google.com/youtube/player_parameters
      autoplay: 0,
    },
  };
  const opt2 = {
    height: "300",
    width: "100%",
    playerVars: {
      // https://developers.google.com/youtube/player_parameters
      autoplay: 0,
    },
  };
  return (
    <div className="row">
      <div className="col-7">
        <div className="col-12">
          <MyYoutube videoid="xBbm8bGytdw" opts={opt1} />
        </div>
      </div>
    </div>
  );
};

export default GenreVideoCard;
